import ArtistPage from "./components/ArtistPage";
import { Header } from "./components/Header";

import {
    BrowserRouter as Router,
    Route,
    Routes,
  } from "react-router-dom";

export default function App(props) {
    return (
        <Router>
            <Routes>
            <Route path="/artists">
                <ArtistPage />
            </Route>
            <Route path="/about">
                <Header />
            </Route>
            <Route path="/">
                <Home />
            </Route>
            </Routes>
        </Router>
    )
}
